const SideBar = ({post}) => {

  return (
      <div className="lg:col-span-3 border-b border-gray-400 xl:border-r xl:border-gray-400 mr-16">
        <div className="text-xl py-10">
          <ul>
            {post.content.sections.map((section) => {
              <>
              <li>{section.heading}</li>
              <br />
              </>
            })}
          </ul>
          1. Introduction
          <br />
          2. Section 1
          <br />
          3. Section 2
          <br />
          4. Section 3
          <br />
          5. Section 4
          <br />
          6. Section 5
          <br />
          7. Conclusion
          <br />
        </div>
      </div>
  );
};

export default SideBar;
